sourcesContent:
import styled from "styled-components";


export const El = styled.li`
  background-color: #cbcbcb;
  padding:8px;
  border-radius:15px;
  margin-top:16px;
  list-style:none;
`;

export const Btn = styled.button`
  color: red;
  background-color: transparent;
  font-family: Manrope;
  font-size: 16px;
  font-style: normal;
  font-weight: 500;
  line-height: 24px;
  border: 0;
  text-decoration-line: underline;
`;

export const IsEmpty = styled.div`
  background-color: #3470ff;
  padding: 12px;
  color:white;
  border-radius: 15px;
margin:16px;
  list-style: none;
`;
